import React, { useState } from "react";
import AuthService from "../../services/auth.service";
import { Link, Outlet, useNavigate } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.css";
import "./User.css";
import toast, { Toaster } from 'react-hot-toast';
import NavBar from "../NavBar";

const Register = () => {
  let navigate = useNavigate();

  const [user, setUser] = useState({
    username: "",
    password: "",
    passwordConf: "",
    firstName: "",
    lastName: "",
    email: "",
  });

  const [loading, setLoading] = useState(false);

  const handleChange = (key, value) => {
    setUser({
      ...user,
      [key]: value,
    });
  };

  const handleRegister = async (e) => {
    e.preventDefault();

    // Validation
    if (user.password !== user.passwordConf) {
      toast.error("Passwords do not match!");
      return;
    }

    if (user.password.length < 8) {
      toast.error("Password must be at least 8 characters long!");
      return;
    }

    if (!user.username || !user.email || !user.firstName || !user.lastName) {
      toast.error("Please fill in all required fields!");
      return;
    }

    setLoading(true);

    try {
      const result = await AuthService.register(user);

      if (result && result.status === 400) {
        // Handle validation errors from the backend
        if (result.data && result.data.username) {
          toast.error("Username already exists!");
        } else if (result.data && result.data.email) {
          toast.error("Email already exists!");
        } else {
          toast.error("Registration failed. Please check your information.");
        }
      } else {
        // Registration successful
        toast.success("Account created successfully! You are now logged in.");
        navigate("/profile");
      }
    } catch (error) {
      console.error("Registration error:", error);
      toast.error("Registration failed. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (

    <div className="background">
      <NavBar />
      <Outlet />
      <div className="container">
        <div className="row mt-5">
          <div className="col">
            <div className="c-form">
              <form onSubmit={handleRegister}>
                <p className="d-flex justify-content-center mt-4 mb-1 s-text">
                  Username
                </p>
                <div className="d-flex justify-content-center">
                  <label htmlFor="username"></label>
                  <input
                    type="text"
                    id="username"
                    name="username"
                    className="rounded border-0 mb-3"
                    onChange={(e) => handleChange("username", e.target.value)}
                    required
                  />
                </div>
                <p className="d-flex justify-content-center mt-2 mb-1 s-text">
                  Email
                </p>
                <div className="d-flex justify-content-center">
                  <label htmlFor="email"></label>
                  <input
                    type="text"
                    id="email"
                    name="email"
                    className="rounded border-0 mb-3"
                    onChange={(e) => handleChange("email", e.target.value)}
                    required
                  />
                </div>
                <p className="d-flex justify-content-center mt-2 pb-1 mb-1 s-text">
                  Password
                </p>
                <div className="d-flex justify-content-center">
                  <label htmlFor="pass"></label>
                  <input
                    type="password"
                    id="pass"
                    name="password"
                    className="rounded border-0 mb-3"
                    minLength="8"
                    required
                    onChange={(e) => handleChange("password", e.target.value)}
                  />
                </div>
                <p className="d-flex justify-content-center mt-2 mb-1 s-text">
                  Confirm Password
                </p>
                <div className="d-flex justify-content-center">
                  <label htmlFor="passConf"></label>
                  <input
                    type="password"
                    id="passConf"
                    name="password"
                    className="rounded border-0 mb-3"
                    minLength="8"
                    required
                    onChange={(e) => handleChange("passwordConf", e.target.value)}
                  />
                </div>
                <p className="d-flex justify-content-center mt-2 mb-1 s-text">
                  First Name
                </p>
                <div className="d-flex justify-content-center">
                  <label htmlFor="firstName"></label>
                  <input
                    type="text"
                    id="firstName"
                    name="fname"
                    className="rounded border-0 mb-3"
                    required
                    onChange={(e) => handleChange("firstName", e.target.value)}
                  />
                </div>
                <p className="d-flex justify-content-center mt-2 mb-1 s-text">
                  Last Name
                </p>
                <div className="d-flex justify-content-center">
                  <label htmlFor="lastName"></label>
                  <input
                    type="text"
                    id="lastName"
                    name="lname"
                    className="rounded border-0"
                    required
                    onChange={(e) => handleChange("lastName", e.target.value)}
                  />
                </div>
                <div className="d-flex justify-content-center">
                  <div className="d-flex justify-content-center flex-column m-4">
                    <input
                      type="submit"
                      value={loading ? "Creating Account..." : "Register"}
                      className="p-2 sqr-btn1 mt-3 px-4 rounded"
                      disabled={
                        loading ||
                        !user.username ||
                        !user.password ||
                        user.password.length < 8 ||
                        user.password !== user.passwordConf ||
                        !user.firstName ||
                        !user.lastName ||
                        !user.email
                      }
                    />
                  </div>
                </div>
              </form>
            </div>
          </div>
        </div>
        <Toaster position="top-center" reverseOrder={false} />
      </div>
    </div>
  );
};

export default Register;
